import styled from 'styled-components';

const Card = () => {
  return (
    <CardWrapper>
      <h1>
        Trump adds Ken Starr and Alan Dershowitz to impeachment defense team -
        CNN
      </h1>
    </CardWrapper>
  );
};

const CardWrapper = styled.div`
  width: 100%;
  border: 1px solid #ddd;
  border-radius: 10px;
  cursor: pointer;
`;

const Content = styled.div`
  width: 100%;
  border: 1px solid #ddd;
  border-radius: 10px;
  cursor: pointer;
`;

const Image = styled.img``;

export default Card;
